pragma solidity >=0.5.0;

contract DeedMultiPayouts {
    
    address public lawyer;
    address payable public beneficiary;
    uint public earliest;
    
    uint public amount;
    uint constant PAYOUTS = 10;
    uint constant INTERVAL = 1;
    uint public paidPayouts = 0;
    
    
    constructor(address _layer,address payable _beneficiary,uint fromNow)public payable{
        lawyer = _beneficiary;
        beneficiary = _beneficiary;
        amount = msg.value/PAYOUTS;
        earliest = block.timestamp + fromNow;
    }
    
    function withdraw() public {
        require(msg.sender == beneficiary, "beneficiary only");
        require(block.timestamp >= earliest, "Current time should be greater than earliest date");
        require(paidPayouts<PAYOUTS,"no payouts left");
        
        uint elligible = (block.timestamp - earliest)/INTERVAL;
        
        elligible = elligible - paidPayouts;
        
        uint due = (elligible + paidPayouts) >= PAYOUTS ? PAYOUTS - paidPayouts : elligible;
        
        paidPayouts += due;
        
        uint toTransfer = due*amount;
        
        beneficiary.transfer(toTransfer);
    }
        
    
}
